using System;\nusing System.Collections.Generic;\n\nclass Program\n{\n    static void Main()\n    {\n        // Example dictionary\n        Dictionary<string, int> myDictionary = new Dictionary<string, int>\n        {\n            { "apple", 1 },\n            { "banana", 2 },\n            { "cherry", 3 }\n        };\n\n        // Get the keys and convert to a list\n        List<string> keysList = new List<string>(myDictionary.Keys);\n\n        // Output the keys\n        foreach (string key in keysList)\n        {\n            Console.WriteLine(key);\n        }\n    }\n}